import React from 'react';
import styled from 'styled-components';

import { NavLink } from 'react-router-dom';
import {Div, Table, Tr, Td} from '../styles/DefaultStyles';


const DivTableEntry = styled(Div)`
  display: flex;
  flex-direction: column;
  justify-content: flex-start;
  align-items: center;
`

const TrStyled = styled(Tr)`
  background-color: ${props => props.theme.COLOR_normal};

  margin-left: 40px;
  margin-right: 40px;
  width: 100%;
  height: 40px;

  border-bottom: 1px solid ${props => props.theme.color_very_weak};


  &:nth-child(1) {
    border-radius: 10px 10px 0 0;
  }

  &:last-child {
    border-radius: 0 0 10px 10px;
    border-bottom-style: none;
  }
`

const TableEntryStyled = styled(Table)`
`

const TrPlayer = () => {

  const listplayer = [
      {_id: "iceman#1111", mmr: 2000}
      ,{_id: "firemadfdffdn#1222", mmr: 1900}
    ]

  return listplayer.map((player, i) => {

    const { _id, mmr } = player //destructuring

    return (
      <TrStyled key={_id}>
         <Td>{_id}</Td>
         <Td>{mmr}</Td>

         <Td>Tank, Bruiser</Td>
         <Td></Td>
      </TrStyled>
     )

  })

}

 const TableEntry = () => {
	return (

  <DivTableEntry>

    <h2 >Entry</h2>

    <TableEntryStyled>
      <tbody>
        {TrPlayer()}
      </tbody>
    </TableEntryStyled>


	</DivTableEntry>

	)
}

export default TableEntry;
